      <Grid>
      <Cell col={4}>
      </Cell>
        <Cell col={8}>
          <div style={{display: 'flex', textAlign: 'right'}}>{this.props.skill}</div>
        </Cell>
      </Grid>
    )
  }
}

export default Skills;
